import React, { useEffect, useState } from 'react';
import { View, Text, Image, StyleSheet, Pressable } from 'react-native';
import firebase from 'firebase';
import { useNavigation } from '@react-navigation/native';

const FirestoreData = () => {
  const [data, setData] = useState([]);
  const navigation = useNavigation();
  useEffect(() => {
    const subscriber = firebase.firestore()
      .collection('Question')
      .onSnapshot(querySnapshot => {
        const newData = [];
        querySnapshot.forEach(documentSnapshot => {
          newData.push({
            ...documentSnapshot.data(),
            key: documentSnapshot.id,
          });
        });

        setData(newData);
      });

    // Unsubscribe from events when no longer in use
    return () => subscriber();
  }, []);

  return (
    <View>
      {data.map(item => (
        <View style={styles.container}>
          <Pressable onPress={()=>navigation.navigate("AnswerPage", {
            questNumber:item.questNumber,
            questImg:item.imgUrl,
            questTranscript:item.transcript,
          })}>
            <Image source={{uri: item.imgUrl}} style={{ width: 200, height: 200 }}></Image>
            <Text>{item.questionNumber} {item.transcript}</Text>
          </Pressable>
        </View>
        ))}
      
    </View>
  );
};

export default FirestoreData;

const styles = StyleSheet.create({
  container: {
    borderWidth: 3,
    borderColor: 'blue',
    borderRadius: 10,
    padding: 10,
    marginHorizontal:20,
    marginVertical:20,
    justifyContent: 'center',
    alignItems: 'center'
  },
})
